    false,nt"url": null,nt"notes": "This data set contains sensitive biological
    resource data for endangered waterbirds and passerine birds, migratory shorebirds
    and waterfowl, gulls and terns, seabirds, raptors, and wading birds in coastal Hawaii.
    Vector polygons in this data set represent locations of bird nesting and foraging
    sites. Species-specific abundance, seasonality, status, life history, and source
    information are stored in relational data tables (described below) designed to be
    used in conjunction with this spatial data layer. This data set comprises a portion
    of the Environmental Sensitivity Index (ESI) data for Hawaii. ESI data characterize
    the marine and coastal environments and wildlife by their sensitivity to spilled
    oil. The ESI data include information for three main components: shoreline habitats,
    sensitive biological resources, and human-use resources. See also the NESTS data
    layer, part of the larger Hawaii ESI database, for additional bird information.",nt"owner_org":
